import React, {Component} from 'react';
import {Container, Row, Col, Input, Button, NavLink, TabPane, Nav} from 'reactstrap';
import Navi from "./Navigation";
import TopBar from "./TopBar"; 

export default class MealPlan extends Component {
  constructor(props) {
    super(props);   
    this.toggle = this.toggle.bind(this);     
    this.state = {      
      activeTab: 1     
    };  
  
  }
  toggle(tab) {
    if(activeTab !== tab) {
      this.setState(activeTab=tab);
    };
  }
  render() {
    return (     
      <div><TopBar/>        
      <Container>  <br/><br/><br/>
      <Row><Col><h1>Meal Plan</h1></Col></Row>
      <Row><Col><Input type="search" name="search" id="exampleSearch" placeholder="Search" /></Col></Row>
      <Nav tabs>
        <NavLink className={classnames({ active: activeTab === '1' })}
          onClick={() => { toggle('1'); }}
        >
          Sunday
        </NavLink>
        <NavLink className={classnames({ active: activeTab === '2' })}
          onClick={() => { toggle('2'); }}
        >
          Monday
        </NavLink>
        <NavLink className={classnames({ active: activeTab === '3' })}
          onClick={() => { toggle('3'); }}
        >
          Tuesday
        </NavLink>
        <NavLink className={classnames({ active: activeTab === '4' })}
          onClick={() => { toggle('4'); }}
        >
          Wednesday
        </NavLink>
        <NavLink className={classnames({ active: activeTab === '5' })}
          onClick={() => { toggle('5'); }}
        >
          Thursday
        </NavLink>
        <NavLink className={classnames({ active: activeTab === '6' })}
          onClick={() => { toggle('6'); }}
        >
          Friday
        </NavLink>
        <NavLink className={classnames({ active: activeTab === '7' })}
          onClick={() => { toggle('7'); }}
        >
          Saturday
        </NavLink>
      </Nav>
      <tabContent>
        <TabPane tabId="1">

        </TabPane>
        <TabPane tabId="2">
          
        </TabPane>
        <TabPane tabId="3">
          
        </TabPane>
        <TabPane tabId="4">
          
        </TabPane>
        <TabPane tabId="5">
          
        </TabPane>
        <TabPane tabId="6">
          
        </TabPane>
        <TabPane tabId="7">
          
        </TabPane>
      </tabContent>  
      <NavLink href="/mealDay"><Button size="lg">Daily Menu</Button></NavLink>                   
      </Container>
      <Navi/> 
      </div>       
    );
  }
}
